import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Home from './pages/home';

function App() {
  return (
    <BrowserRouter>
    <Route path="/" element={<Home />}> </Route>
  </BrowserRouter>
  );
}

export default App;
